import React from 'react'
import ImagenScr from '../images/exercise.png'
import circlesImg from '../images/circles.png'
import './styles/Card.css'
import 'bootstrap/dist/css/bootstrap.css'

class Card extends React.Component {
    //background: url('../../images/circles.png') no-repeat, linear-gradient(to right, #A74CF2, #617BFB)
    render() {
        return (
            <div className="card mx-auto Fitness-Card"
                style={{
                    backgroundImage: `url(${circlesImg}), linear-gradient(to right, ${this.props.right}, ${this.prp})`
                }}
                >
                <div className="card-body">
                    <div className="row center">
                        <div className="col-6">
                            <img src={this.props.img} />
                        </div>
                        <div className="col-6 Fitness-Card-Info">
                            <h1>{this.props.title}</h1>
                            <p>{this.props.description}</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Card
